const tintColorLight = '#fff';
const tintColorDark = '#000';

export default {
  light: {
    text: '#fff',
    background: '#F3E9D2',
    tint: tintColorLight,
    tabIconDefault: '#ccc',
    tabIconSelected: tintColorLight,
  },
  dark: {
    text: '#fff',
    background: '#fff',
    tint: tintColorDark,
    tabIconDefault: '#000',
    tabIconSelected: tintColorDark,
  },
};
